column4:
Калі праграма не выкарыстоўвалася некалькі месяцаў:

• у мэтах абароны вашых даных выдаляюцца дазволы;
• дзеля эканоміі зараду акумулятара спыняюцца апавяшчэнні;
• для вызвалення месца выдаляюцца часовыя файлы.

Каб зноў уключыць дазволы і апавяшчэнні, адкрыйце праграму.
